            .then(result => props.setSwapi(result.data.results));
    }

    let getUserAll = () => {
        axios.get("https://swapi.dev/api/people")
            .then(result => console.log(result));
    }

    getUserAll();

    let swapis = props.swapiData.map((swapi)=><SwapiItem name={swapi.data.results.name}/>)

